script_author("Cosmo")
script_name("Speedometer X")
script_properties("work-in-pause")

local ffi      	= require "ffi"
local imgui 	= require "mimgui"
local memory 	= require "memory"
local ini 		= require "inicfg"

local cfg = ini.load({
	main = {
		state = true,
		multiplier = 1.0
	},
	pos_offset = {
		x = 280, 
		y = 20
	}
}, thisScript().name .. ".ini")

imgui.OnInitialize(function()
	imgui.SwitchContext()
	imgui.GetStyle().AntiAliasedFill = false
	sW, sH = getScreenResolution()

	local glyph_ranges = imgui.GetIO().Fonts:GetGlyphRangesCyrillic()
    font = {
    	[20] = imgui.GetIO().Fonts:AddFontFromMemoryCompressedBase85TTF(font_data, 20.0, nil, glyph_ranges),
    	[80] = imgui.GetIO().Fonts:AddFontFromMemoryCompressedBase85TTF(font_data, 80.0, nil, glyph_ranges)
    }
end)

Vehicle = {} -- // Class vehicle
function Vehicle:new(handle, speed_multiplier)
	if not doesVehicleExist(handle) then
		return nil
	end

	local public = {
		handle = handle,
		speed_multiplier = speed_multiplier,
		max_speed = 0
	}

	function public:IsEngineOn()
		return isCarEngineOn(self.handle)
	end

	function public:GetSpeed()
    	local speed = getCarSpeed(self.handle)
		return speed * self.speed_multiplier
	end

	function public:GetGear()
		if getCarSpeed(self.handle) >= 1 then
			local gear = getCarCurrentGear(self.handle)
			return (gear == 0) and "R" or tostring(gear)
		end
		return "N"
	end

	function public:GetRPM()
	    if isCarEngineOn(self.handle) then
	        local speed = getCarSpeed(self.handle) * 2
	        local gear = getCarCurrentGear(self.handle)
	        local rpm = (gear > 0) and (speed / gear) * 250 or speed * 180
            if rpm < 650 then
            	math.randomseed(os.time())
            	rpm = math.random(650, 900)
            elseif rpm >= 8000 then 
            	rpm = 8000
            end
            return rpm
	    end
	    return 0
	end

	local model = getCarModel(handle)
	local handling = memory.getint32(model * 0x4 + 0xA9B0C8, false)
	local header = memory.getint16(handling + 0x4A, false)

	if header ~= nil then
		local tHandlingData = 0xC2B9DC + (header * 0xE0)
		local fMaxGearVelocity = memory.getfloat(tHandlingData + 0x84, false)
		public.max_speed = (fMaxGearVelocity * 50) * speed_multiplier
	end

	setmetatable(public, self)
	self.__index = self
	return public
end

function main()
	ini.save(cfg, thisScript().name .. ".ini")
	while true do wait(0)
		if isCharInAnyCar(PLAYER_PED) and cfg.main.state then
			local car = storeCarCharIsInNoSave(PLAYER_PED)
		   	if getDriverOfCar(car) == PLAYER_PED then
				vehicle = Vehicle:new(car, cfg.main.multiplier)
				while isCharInCar(PLAYER_PED, car) do wait(0) end
				vehicle = nil
			end
		end
	end
end

local main_frame = imgui.OnFrame(
	function() return vehicle ~= nil and not isPauseMenuActive() and not sampTextdrawIsExists(132) end, 
	function(self)
		self.HideCursor = true

		local DL = imgui.GetForegroundDrawList()
		local pos = imgui.ImVec2(sW - cfg.pos_offset.x, sH - cfg.pos_offset.y)

		if vehicle == nil then return end
		local speed = vehicle:GetSpeed()
		local rpm = vehicle:GetRPM()
		local gear = vehicle:GetGear()

		-- // Tachometer
		local width = 3 			-- // Width of the strokes
		local spacing = 2 			-- // The distance between strokes
		local tilt = 3 				-- // Tilt of the strokes
		local strokes = { 40, 10 } 	-- // Normal (white) and Critical (red)
		function strokes:count() return self[1] + self[2] end
		local l1 = { h = 15, color = { [false] = 0x30FFFFFF, [true] = 0xFFFFFFFF } }
		local l2 = { h = 20, color = { [false] = 0x706060FF, [true] = 0xFF6060FF } }

		local X = pos.x
		for i = 1, strokes:count() do
			local isActive = rpm >= (8000 / strokes:count()) * i

			if i <= strokes[1] then
				DL:PathClear()
				DL:PathLineTo(imgui.ImVec2( X + width, pos.y ))
				DL:PathLineTo(imgui.ImVec2( X + width + tilt, pos.y - l1.h ))
				DL:PathLineTo(imgui.ImVec2( X + tilt, pos.y - l1.h ))
				DL:PathLineTo(imgui.ImVec2( X, pos.y ))
				DL:PathFillConvex(l1.color[isActive])
			else 
				DL:PathClear()
				DL:PathLineTo(imgui.ImVec2( X + width, pos.y ))
				DL:PathLineTo(imgui.ImVec2( X + width + tilt + 1.2, pos.y - l2.h ))
				DL:PathLineTo(imgui.ImVec2( X + tilt + 1.2, pos.y - l2.h ))
				DL:PathLineTo(imgui.ImVec2( X, pos.y ))
				DL:PathFillConvex(l2.color[isActive])
			end
			X = X + width + spacing
		end

		-- // Speed bar
		local absolute_len = (strokes[1] - 1) * (width + spacing) + width
		local bar_len = (absolute_len / vehicle.max_speed) * speed
		if bar_len > absolute_len then bar_len = absolute_len end
		if bar_len < 0 then bar_len = 0 end
		local bar_offs = imgui.ImVec2(3, l1.h + 2)
		local bar_tilt = 0.9
		DL:PathClear()
		DL:PathLineTo(imgui.ImVec2( pos.x + bar_len + bar_offs.x, pos.y - bar_offs.y ))
		DL:PathLineTo(imgui.ImVec2( pos.x + bar_len + bar_tilt + bar_offs.x, pos.y - width - bar_offs.y ))
		DL:PathLineTo(imgui.ImVec2( pos.x + bar_tilt + bar_offs.x, pos.y - width - bar_offs.y ))
		DL:PathLineTo(imgui.ImVec2( pos.x + bar_offs.x, pos.y - bar_offs.y ))
		DL:PathFillConvex(0xFFFFFFFF)

		DL:PathClear()
		DL:PathLineTo(imgui.ImVec2( pos.x + absolute_len + bar_offs.x, pos.y - bar_offs.y ))
		DL:PathLineTo(imgui.ImVec2( pos.x + absolute_len + bar_tilt + bar_offs.x, pos.y - width - bar_offs.y ))
		DL:PathLineTo(imgui.ImVec2( pos.x + bar_len + bar_tilt + bar_offs.x, pos.y - width - bar_offs.y ))
		DL:PathLineTo(imgui.ImVec2( pos.x + bar_len + bar_offs.x, pos.y - bar_offs.y ))
		DL:PathFillConvex(0x30FFFFFF)
		
		-- // Digital speed counter
	    imgui.PushFont(font[80])
	    local symbols = speed >= 1000 and string.len(math.modf(speed)) or 3
	    local str_speed = string.format("%0" .. symbols .. "d", speed)
	    local text_size = imgui.CalcTextSize(str_speed)
	    local l_height = imgui.GetTextLineHeight()
	   	local full_len = (strokes:count() - 1) * (width + spacing) + width
	   	local offset = imgui.ImVec2(5, 10)

	    local cPos = imgui.ImVec2(
	    	pos.x + full_len - text_size.x + offset.x, 
	    	pos.y - l_height - offset.y
	    )

	    local filled = false
	    for i = 1, symbols do
	    	local n = string.sub(str_speed, i, i)
	    	if n == "0" and i ~= symbols and not filled then
	    		DL:AddText(cPos, 0x30FFFFFF, n)
	    	else
	    		DL:AddText(cPos, 0xFFFFFFFF, n)
	    		filled = true
	    	end
	    	if i ~= symbols then
	    		cPos.x = cPos.x + imgui.CalcTextSize(n).x
	    	end
	    end
	    imgui.PopFont()

	    -- // Metric indicator
	    imgui.PushFont(font[20])
	    local metric = "MPH"
	    local met_len = imgui.CalcTextSize(metric).x
    	local metricPos = imgui.ImVec2(
    		pos.x + full_len - text_size.x + offset.x - met_len - 5, 
    		pos.y - l_height - offset.y + 46
    	)
		DL:AddText(metricPos, 0x60FFFFFF, metric)

		-- // Gear indicator
		local cCenter = imgui.ImVec2(
	    	metricPos.x + (met_len / 2), 
	    	metricPos.y - text_size.y + offset.y + (13 * 2) * 2
	    )
		DL:AddCircle(cCenter, 13, 0x60FFFFFF, 36, 2)

		local gs = imgui.CalcTextSize(gear)
		cCenter.x = cCenter.x - (gs.x / 2) - (gear == "N" and 0 or 1)
		cCenter.y = cCenter.y - (gs.y / 2)
		DL:AddText(cCenter, 0xFFFFFFFF, gear)
		imgui.PopFont()		
	end
)

